import React from 'react';
import "./Nav.css" ; 
import { useState , useEffect} from "react";
function Nav() {


    const [show,handelshow] = useState(false); 

    const transitionNavBar = () => {
        if(window.scrollY > 100 )
        {
            handelshow(true);
        }
        else{
            handelshow(false); 
        }
    }


   useEffect(() => {
        window.addEventListener("scroll" , transitionNavBar );  

        return () => window.removeEventListener("scroll",transitionNavBar); 
        
   }, []);

    return (
    <div className= {`nav ${ show && 'nav__black'} `} >
 
              <div className="nav__contents" >
                  
                  < img className="nav__logo"  src ="https://cdn.vox-cdn.com/thumbor/Yq1Vd39jCBGpTUKHUhEx5FfxvmM=/39x0:3111x2048/1200x800/filters:focal(39x0:3111x2048)/cdn.vox-cdn.com/uploads/chorus_image/image/49901753/netflixlogo.0.0.png" alt ="" /> 
                  < img className="nav__avatar" src ="data:image/png;base64," alt ="" /> 
       
              </div>

    
       </div>
    )
}

export default Nav
